import React, {FC} from 'react';
import './App.css';

const App: FC = () => {
  return (
    <div className="App">
     <div className="header">
      <input type="text" placeholder="task.." />
     </div>
     <div className="todoList"></div>
    </div>
  );
}

export default App;
